import ListItem from './Listitem';




function List(props){

    return(
        <ul>
            {/* <li>{text}</li> exibindo o valor do input na lista  */}
            {props.items.map(item=><ListItem item={item} onDone={props.onDone} onItemDeleted></ListItem>)}             
        </ul>
    )
    
}

